    false,nt"url": null,nt"notes": "Sediment and biotic samples were collected
    from four locations on the Anahuac National Wildlife Refuge for a contaminant survey.
    Contaminants examined in the analysis included organochlorine and organophosphate
    pesticides, heavy metals, and petroleum hydrocarbons. Analytical results indicate
    the refuge is, for the most part, not contaminated by these chemicals. Two localized
    areas have minor contaminant problems. Petroleum hydrocarbons contaminate the irrigation
    canal sediment near a diesel-powered lift pump and the bottom sediments of Jackson
    Ditch near a petroleum production area. Four heavy metals (chromium, copper, nickel,
    and silver) were also present at elevated levels in the sediment of Jackson Ditch,
    relative to other locations on the refuge.",nt"license_title": "License Not
